import React, { Component } from "react";
import { motion } from "framer-motion";
import { Link, Router } from "react-router-dom";

const middle = {
  rest: { width: 28 },
  tap: {
    scale: 2,
    transition: {
      duration: 1,
    },
  },
};

const topbottom = {};

class HamburgerNav extends Component {
  state = {};
  render() {
    return (
      <motion.a
        href="#"
        style={{
          textDecoration: "none",
          position: "relative",
        }}
        initial="rest"
        whileHover="tap"
        animate="rest"
      >
        <div>
          <motion.div
            style={{ height: 4, width: 28, backgroundColor: "black" }}
          ></motion.div>
          <motion.div
            style={{
              height: 4,
              backgroundColor: "black",
              position: "relative",
              top: 10,
            }}
            variants={middle}
          ></motion.div>
          <motion.div
            style={{
              height: 4,
              width: 28,
              backgroundColor: "black",
              position: "relative",
              bottom: 1,
            }}
          ></motion.div>
        </div>
      </motion.a>
    );
  }
}

export default HamburgerNav;
